import React from "react";
import { Link } from "react-router-dom";

const RatingQuestion = (props) => {
  return (
    <div className="question">
      <h3>{props.question}</h3>

      <div className="radios">
        <h6>Disagree</h6>
        <input type="radio" id="o1" name="s1" />
        <input type="radio" id="o2" name="s1" />
        <input type="radio" defaultChecked id="o3" name="s1" />
        <input type="radio" id="o4" name="s1" />
        <input type="radio" id="o5" name="s1" />
        <h6>Agree</h6>
      </div>
    </div>
  );
};

export default RatingQuestion;
